        "doc": "<p>Shorthand for <a href=\"#/api/Ext.chart.series.Column-method-removeManagedListener\" rel=\"Ext.chart.series.Column-method-removeManagedListener\" class=\"docClass\">removeManagedListener</a>.</p>\n\n<p>Removes listeners that were added by the <a href=\"#/api/Ext.chart.series.Column-method-mon\" rel=\"Ext.chart.series.Column-method-mon\" class=\"docClass\">mon</a> method.</p>\n"
