  "name": "Ext.chart.series.Column",
  "doc": "<p>Creates a Column Chart. Much of the methods are inherited from Bar. A Column Chart is a useful visualization technique to display quantitative information for different\ncategories that can show some progression (or regression) in the data set.\nAs with all other series, the Column Series must be appended in the <em>series</em> Chart array configuration. See the Chart\ndocumentation for more information. A typical configuration object for the column series could be:</p>\n\n<p><p><img src=\"doc-resources/Ext.chart.series.Column/Ext.chart.series.Column.png\" alt=\"Ext.chart.series.Column chart series\"></p></p>\n\n<h2>Example</h2>\n\n<pre><code>var store = Ext.create('Ext.data.JsonStore', {\n    fields: ['name', 'data1', 'data2', 'data3', 'data4', 'data5'],\n    data: [\n        {'name':'metric one', 'data1':10, 'data2':12, 'data3':14, 'data4':8, 'data5':13},\n        {'name':'metric two', 'data1':7, 'data2':8, 'data3':16, 'data4':10, 'data5':3},\n        {'name':'metric three', 'data1':5, 'data2':2, 'data3':14, 'data4':12, 'data5':7},\n        {'name':'metric four', 'data1':2, 'data2':14, 'data3':6, 'data4':1, 'data5':23},\n        {'name':'metric five', 'data1':27, 'data2':38, 'data3':36, 'data4':13, 'data5':33}                                                \n    ]\n});\n\nExt.create('Ext.chart.Chart', {\n    renderTo: Ext.getBody(),\n    width: 500,\n    height: 300,\n    animate: true,\n    store: store,\n    axes: [{\n        type: 'Numeric',\n        position: 'bottom',\n        fields: ['data1'],\n        label: {\n            renderer: Ext.util.Format.numberRenderer('0,0')\n        },\n        title: 'Sample Values',\n        grid: true,\n        minimum: 0\n    }, {\n        type: 'Category',\n        position: 'left',\n        fields: ['name'],\n        title: 'Sample Metrics'\n    }],\n        axes: [{\n            type: 'Numeric',\n            position: 'left',\n            fields: ['data1'],\n            label: {\n                renderer: Ext.util.Format.numberRenderer('0,0')\n            },\n            title: 'Sample Values',\n            grid: true,\n            minimum: 0\n        }, {\n            type: 'Category',\n            position: 'bottom',\n            fields: ['name'],\n            title: 'Sample Metrics'\n        }],\n        series: [{\n            type: 'column',\n            axis: 'left',\n            highlight: true,\n            tips: {\n              trackMouse: true,\n              width: 140,\n              height: 28,\n              renderer: function(storeItem, item) {\n                this.setTitle(storeItem.get('name') + ': ' + storeItem.get('data1') + ' $');\n              }\n            },\n            label: {\n              display: 'insideEnd',\n              'text-anchor': 'middle',\n                field: 'data1',\n                renderer: Ext.util.Format.numberRenderer('0'),\n                orientation: 'vertical',\n                color: '#333'\n            },\n            xField: 'name',\n            yField: 'data1'\n        }]\n});\n</code></pre>\n\n<p>In this configuration we set <code>column</code> as the series type, bind the values of the bars to the bottom axis, set <code>highlight</code> to true so that bars are smoothly highlighted\nwhen hovered and bind the <code>xField</code> or category field to the data store <code>name</code> property and the <code>yField</code> as the data1 property of a store element.</p>\n",
  "extends": "Ext.chart.series.Bar",
  "docauthor": null
